pragma solidity >=0.6.12;
pragma experimental ABIEncoderV2;

import "../open/token/ERC721/ERC721.sol";
import "../open/token/ERC20/IERC20.sol";
import "../open/utils/SafeMath.sol";
import "../open/utils/Strings.sol";
import "../open/utils/Address.sol";
import "../open/utils/Initializable.sol";
import "../open/utils/Ownable.sol";
import "../libraries/Random.sol";
import "../nftLib/FishNftFactory.sol";

interface Factory{
    function getTypes() external view returns(uint[] memory);
}

// interface IPancakeRouter02{
