contract MysteryBox is  Initializable,Ownable {

    event OpenBox(uint256 indexed id, address indexed nft, uint256 boxId, uint256 tokenId);
    event Minted(uint256 indexed id, uint256 indexed factoryId, address to);

    using SafeMath for uint256;

    mapping(address => Nft1155Factory) public factoryMap;

    address[] supportNftList;

    mapping(address => uint[]) nftSupportLevels;

    struct Box {
        uint256 id;
        string name;
        uint256 price;
        uint256 total;
        address[] suppoutNfts;
        mapping(address => uint) nft2Surplus;
        mapping(address => mapping(uint => uint)) nft2Level2Surplus;
    }

    struct BoxView {
        uint256 id;         //id
        string name;        //
        uint total;         //
        uint price;         //
        address currency;   //
    }

    IERC20 public payToken;

    Box[] internal boxList;

    uint accSeed;

    struct BoxResult{
        address nft;    
        uint level;
    }

    mapping( bytes32 => BoxResult) public boxResults;

    constructor() public {}

    function initialize(
            address _payToken,
            address _ownerAddress
            ) public {
        payToken = IERC20(_payToken);
        _owner = _ownerAddress;
        accSeed = 10000;
    }

    function setBoxPrice(uint index,uint price)external onlyOwner{
        boxList[index].price = price;
    }

    function getBoxPrice(uint index)external view returns(uint){
        return boxList[index].price;
    }

    function getBoxLength()external view returns(uint){
        return boxList.length;
    }

    function getSupportNfts()external view returns(address[] memory){
        return supportNftList;
    }

    function getNftSupportLevels(address nft)external view returns(uint[] memory){
        return nftSupportLevels[nft];
    }

    function getBoxs()public view returns(BoxView[] memory boxs){

        uint len = boxList.length;
        boxs = new BoxView[](len);
        for( uint i = 0; i< len; i++ ){
            BoxView memory box;
            box.id  = boxList[i].id;
            box.name  = boxList[i].name;
            box.price  = boxList[i].price;
            box.total  = boxList[i].total;
            box.currency  = address(payToken);
            boxs[i] = box;
        }
    }

    // function _equivalent(address token1,uint amount1,address token2)internal view returns(uint){

    //     address[] memory path = new address[](2);
    //     path[0] = token1;
    //     path[1] = token2;
    //     uint[] memory amountOuts = route.getAmountsOut(amount1, path);

    //     require(amountOuts.length == path.length,"getAmountsOut error");
    //     return amountOuts[1];
    // }
    
    function buyBox(uint256 boxId,bytes32 flag) external {

        require(isContract(msg.sender) == false && tx.origin == msg.sender, "Prohibit contract calls");

        Box storage box = boxList[boxId];

        uint needAmount = box.price;

        payToken.transferFrom(msg.sender, address(this), needAmount);
        
        require(box.total > 0,"amount lock");

        box.total --;

        (address nft,uint level) = _random(box);

        factoryMap[nft].mint(msg.sender,level,1);

        boxResults[flag] = BoxResult( nft,level);
    }

    function _random(Box storage box)internal returns(address nft,uint  level) {
        
        uint256 seed = uint256(keccak256(abi.encodePacked(block.coinbase,block.timestamp,accSeed)));

        uint seed1 = seed % box.total;

        nft = _getNft(box,seed1);
        require(nft != address(0),"type random error");

        uint nft2Sruplus = box.nft2Surplus[nft];

        uint seed2 = seed % nft2Sruplus;
        level = _getLevel(nft,box,seed2);
        require(level != 0,"level random error");

        accSeed += (seed % accSeed); 
    }

    function _getNft(Box storage box,uint seed)internal view returns(address nft){

        address[] memory nfts = box.suppoutNfts;

        uint len = nfts.length;

        uint256 sum = 0;
        for( uint256 i = 0; i < len ; i++){
            
            sum += box.nft2Surplus[nfts[i]];

            if( seed <= sum && nft == address(0) ){
                nft = nfts[i];
            }
        }
    }

    function _getLevel(address nft,Box storage box,uint seed)internal view returns(uint level){

        uint[] storage levels = nftSupportLevels[nft];

        uint len = levels.length;

        uint256 sum = 0;
        for( uint256 i = 0; i < len ; i++){

            sum += box.nft2Level2Surplus[nft][levels[i]];

            if( seed <= sum && level == 0){
                level = levels[i];
            }
        }
    }

    
    function isContract(address addr) internal view returns (bool) {
        uint size;
        assembly { size := extcodesize(addr) }
        return size > 0;
    }

    function addSupportNft(address nft,address factory)external onlyOwner{
        supportNftList.push(nft);
        factoryMap[nft] = Nft1155Factory(factory);
        nftSupportLevels[nft] = Factory(factory).getTypes();
    }

    function initLevels(address[] memory nfts)external onlyOwner{
        for( uint i = 0; i < nfts.length; i ++ ){
            nftSupportLevels[nfts[i]] = [1,2,3,4,5];
        }
    }

    function getNft2Sruplus(uint index,address nft)external view returns(
            uint amount,
            address[] memory supportNfts,
            uint[] memory levels ){


        Box storage box  = boxList[index];

        amount = box.nft2Surplus[nft];
        supportNfts = box.suppoutNfts;
        levels = nftSupportLevels[nft];
    }


    function getNft2Level2Surplus(uint index,address nft,uint level)external view returns(uint){
        Box storage box  = boxList[index];

        return box.nft2Level2Surplus[nft][level];
    }
    
    
    
    function initBox(
        string memory _name,
        uint256 _price,
        address[] memory nfts,
        uint[][] memory levelList,
        uint[][] memory amountList)external onlyOwner{

            uint id = boxList.length;

            boxList.push(Box(
                id,
                _name,
                _price,
                0,
                new address[](0)
            )) ;

            Box storage box  = boxList[id];

            uint len = nfts.length;

            uint sum = 0;
            for( uint i = 0; i < len; i++ ){
                address nft = nfts[i];

                box.suppoutNfts.push(nft);

                uint[] memory levels = levelList[i];
                uint[] memory amounts = amountList[i];

                require(levels.length == amounts.length,"params error");

                uint l = levels.length;

                uint s1 = 0;
                for( uint k = 0; k < l; k++ ){
                    box.nft2Level2Surplus[nft][levels[k]] += amounts[k];
                    s1 += amounts[k];
                }
                box.nft2Surplus[nft] += s1;
                sum += s1;
            }
            box.total += sum;
    }

    function addBox(uint index,address nft,uint level,uint amount)external onlyOwner{
        Box storage box  = boxList[index];
        box.total += amount;
        box.nft2Surplus[nft] += amount;
        box.nft2Level2Surplus[nft][level] += amount;
    }
}
